import React from "react";

function Months(props) {


    return (
        <React.Fragment>
            <Breadcrumb.Item onClick={() => props.handleClick('month', props.month)}>
                {props.monthNames[props.month - 1]}
            </Breadcrumb.Item>
        </React.Fragment >
    )


}

export default Months;
